import 'animate.css'
import React from "react";
import loadingPic from './loading.png'
const LandingPage = () => {
  return (
    <main className='flex justify-center align-middle items-center animate__animated animate__fadeOut animate__deka'>
      <div className='block items-center'>
        <img className=' w-1/4 h-1/4' src={loadingPic}/>
      </div>
      
    </main>
  );
};



export default LandingPage;
